import React from 'react';
import { Card, Container, Row, Col } from 'react-bootstrap';

const Product = ({ id, name, price, image }) => {
  return (
    <Col key={id} md={4} sm={6}>
      <Card>
        <Card.Img variant="top" src={image} />
        <Card.Body>
          <Card.Title>{name}</Card.Title>
          <Card.Text>Preço: R${price}</Card.Text>
        </Card.Body>
      </Card>
    </Col>
  );
};

const Products = () => {
  const products = [
    { id: 1, name: 'Boné', price: 10.99, image: 'data:image/jpeg;base64,' },
    { id: 2, name: 'Chaveiro', price: 19.99, image: 'data:image/jpeg;base64,' },
    { id: 3, name: 'Carteira', price: 14.99, image: 'data:image/jpeg;base64,' },
    { id: 4, name: 'Relógio', price: 299.99, image: 'data:image/jpeg;base64,'},
    { id: 4, name: 'Relógio', price: 299.99, image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTVVD5ZGfFuYkBEoO9HrxV_93TDWbG_b2868w&usqp=CAU' },
    { id: 5, name: 'Mochila', price: 122.99, image: 'data:image/jpeg;base64,'},
  ];

  return (
    <Container>
      <Row>
        {products.map((product) => (
          <Product
            key={product.id}
            id={product.id}
            name={product.name}
            price={product.price}
            image={product.image}
          />
        ))}
      </Row>
    </Container>
  );
};

export default Products;
